tested-commands:
  - ZRANGE
redis-topologies:
  - oss-standalone

build-variants:
  - gcc:8.5.0-amd64-debian-buster-default

clientconfig:
  run_image: redislabs/memtier_benchmark:edge
  tool: memtier_benchmark
  arguments: '--command="ZRANGE zset:1000 0 1 BYSCORE WITHSCORES"  --hide-histogram --test-time 180'
  resources:
